import React from 'react';
import CardList from './CardList';
import {robots} from './robots';

const App = prop => {
	return (
		<>
			<h1> RoboFriends </h1>
			<input type="search" placeholder = "search for robots" />
			<CardList robots={robots}/>
		</>
		);
}




export default App;
